import * as React from 'react';
import { Typography, Divider, ThemeProvider } from '@material-ui/core';

const Footer = () => {
  return (
    <div className='footer'>
      <ThemeProvider theme={props.muiTheme}>
        <Divider variant="middle" />
      </ThemeProvider>
      <Typography variant='h3'>This is the Footer</Typography>
    </div>
  );
}
export default Footer;
